import logo from './logo.svg';
import './App.css';
import SignUp from './Components/SignUpScreen';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
function App() {
  return (
   <>
 <BrowserRouter>
        <Switch>
          <Route path="/" >
            <SignUp />
          </Route>
        </Switch>
      </BrowserRouter>
   </>
  );
}

export default App;
